import React from 'react'
import { Chart } from "react-google-charts";

class Table extends React.Component{


  netto = () =>{
    console.log(this.props.state)
  return  <h3 style={!!this.props.total[this.props.total.length-1]&&this.props.total[this.props.total.length-1][1]-this.props.breakevenpoint>0?
    {color: "green"}:
    {color: "red"}}>
   Netto {!!this.props.total[this.props.total.length-1]?
    this.props.total[this.props.total.length-1][1]:
    null} </h3>
  }
render(){
  console.log((!!this.props.total[this.props.total.length-1]?this.props.total[this.props.total.length-1][1]:null))

  return(
    <div>
    {this.netto()}
    <Chart
      width={'1000px'}
      height={'500px'}
      chartType="Table"
      loader={<div>Loading Chart</div>}
      data={[
        [
          { type: 'string', label: 'Coin' },
          { type: 'number', label: 'Amount' },
          { type: 'number', label: 'Initial Price per Unit (EUR)' },
          { type: 'number', label: 'Total (EUR)' },
          { type: 'number', label: 'Netto' },
        ],
        ['Mike', 100, 100,100,100],

      ]}
      options={{
        showRowNumber: true,
        colors: ['#e0440e', '#e6693e', '#ec8f6e', '#f3b49f', '#f6c7b6']
      }}
      rootProps={{ 'data-testid': '1' }}
    />
    </div>
  )
}
}

export default Table
